import{_ as i,o as l,c as a,e}from"./app.8dceef42.js";var r="/images/TIL/CS-OS/\uC7A5\uCE58\uAD00\uB9AC/\uC7A5\uCE58-\uBB3C\uB9AC\uC801\uAD6C\uC131.png";const h={},d=e('<h1 id="\u110C\u1161\u11BC\u110E\u1175-\u1100\u116A\u11AB\u1105\u1175" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u11BC\u110E\u1175-\u1100\u116A\u11AB\u1105\u1175" aria-hidden="true">#</a> \uC7A5\uCE58 \uAD00\uB9AC</h1><ul><li>CPU, \uBA54\uBAA8\uB9AC: <strong>\uD504\uB85C\uC138\uC2A4 \uC2E4\uD589</strong>\uC5D0 \uD544\uC218</li><li>\uB098\uBA38\uC9C0 \uC7A5\uCE58\uB4E4: \uD504\uB85C\uC138\uC2A4 \uC2E4\uD589 \uC2DC \uB370\uC774\uD130 \uC785\uB825\uC774\uB098 \uCD9C\uB825\uC5D0 \uC0AC\uC6A9\uD558\uB294 \uC785\uCD9C\uB825\uC7A5\uCE58</li></ul><h2 id="\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8\u110C\u1161\u11BC\u110E\u1175\u110B\u1174-\u1100\u116E\u1107\u116E\u11AB" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8\u110C\u1161\u11BC\u110E\u1175\u110B\u1174-\u1100\u116E\u1107\u116E\u11AB" aria-hidden="true">#</a> \uC785\uCD9C\uB825\uC7A5\uCE58\uC758 \uAD6C\uBD84</h2><ul><li>\uC7A5\uCE58\uC758 \uAE30\uB2A5\uC801 \uD2B9\uC9D5\uACFC \uC7A5\uCE58 \uAD00\uB9AC\uC790\uC758 \uAD00\uB9AC \uBC29\uBC95\uC5D0 \uB530\uB77C \uAD6C\uBD84</li><li>\uC138 \uAC00\uC9C0 \uBC94\uC8FC: \uC804\uC6A9\uC7A5\uCE58, \uACF5\uC6A9\uC7A5\uCE58, \uAC00\uC0C1\uC7A5\uCE58</li></ul><h3 id="\u110C\u1165\u11AB\u110B\u116D\u11BC\u110C\u1161\u11BC\u110E\u1175" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11AB\u110B\u116D\u11BC\u110C\u1161\u11BC\u110E\u1175" aria-hidden="true">#</a> \uC804\uC6A9\uC7A5\uCE58</h3><ul><li>\uD55C \uBC88\uC5D0 \uB2E8\uC9C0 \uD558\uB098\uC758 \uD504\uB85C\uC138\uC2A4\uC5D0\uB9CC \uD560\uB2F9</li><li>ex) \uD14C\uC774\uD504 \uB4DC\uB77C\uC774\uBE0C, \uD504\uB9B0\uD130, \uD50C\uB85C\uD130 \uB4F1</li><li>\uB2E8\uC810 : \uB300\uAE30\uC2DC\uAC04\uC774 \uAE38\uC5B4\uC9C8 \uC218 \uC788\uC74C</li></ul><h3 id="\u1100\u1169\u11BC\u110B\u116D\u11BC\u110C\u1161\u11BC\u110E\u1175" tabindex="-1"><a class="header-anchor" href="#\u1100\u1169\u11BC\u110B\u116D\u11BC\u110C\u1161\u11BC\u110E\u1175" aria-hidden="true">#</a> \uACF5\uC6A9\uC7A5\uCE58</h3><ul><li>\uC5EC\uB7EC \uD504\uB85C\uC138\uC2A4\uC5D0 \uB3D9\uC2DC\uC5D0 \uD560\uB2F9</li><li>ex) \uB514\uC2A4\uD06C \uAC19\uC740 \uC9C1\uC811\uC811\uADFC \uC800\uC7A5\uC7A5\uCE58</li><li>\uC2A4\uCF00\uC904\uB9C1 \uAE30\uBC95 \uD544\uC694\uD568</li></ul><h3 id="\u1100\u1161\u1109\u1161\u11BC\u110C\u1161\u11BC\u110E\u1175" tabindex="-1"><a class="header-anchor" href="#\u1100\u1161\u1109\u1161\u11BC\u110C\u1161\u11BC\u110E\u1175" aria-hidden="true">#</a> \uAC00\uC0C1\uC7A5\uCE58</h3><ul><li><strong>\uC804\uC6A9\uC7A5\uCE58\uB97C \uAC00\uC0C1\uC758 \uACF5\uC6A9\uC7A5\uCE58\uCC98\uB7FC \uBCF4\uC774\uAC8C \uD568</strong></li><li>\uB514\uC2A4\uD06C \uAC19\uC740 \uACF5\uC6A9\uC7A5\uCE58\uB97C \uC774\uC6A9</li><li>ex) \uC2A4\uD480\uB9C1\uC744 \uC801\uC6A9\uD55C \uD50C\uB85C\uD130 \uB4F1</li></ul><h2 id="\u110C\u1161\u11BC\u110E\u1175\u110B\u1174-\u1100\u116E\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u11BC\u110E\u1175\u110B\u1174-\u1100\u116E\u1109\u1165\u11BC" aria-hidden="true">#</a> \uC7A5\uCE58\uC758 \uAD6C\uC131</h2><h3 id="\u1102\u1169\u11AB\u1105\u1175\u110C\u1165\u11A8-\u1100\u116E\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1102\u1169\u11AB\u1105\u1175\u110C\u1165\u11A8-\u1100\u116E\u1109\u1165\u11BC" aria-hidden="true">#</a> \uB17C\uB9AC\uC801 \uAD6C\uC131</h3><ul><li><p><strong>\uC7A5\uCE58 \uC81C\uC5B4\uAE30</strong></p><ul><li>\uC7A5\uCE58\uB97C \uC9C1\uC811\uC801\uC73C\uB85C \uB2E4\uB8E8\uB294 \uC804\uC790\uC7A5\uCE58</li><li>\uC7A5\uCE58\uC5D0\uC11C \uBC1C\uC0DD\uD558\uB294 \uB370\uC774\uD130\uB97C \uC804\uC790\uC2E0\uD638\uB85C \uBCC0\uD658\uD558\uC5EC \uC6B4\uC601\uCCB4\uC81C\uB85C \uBCF4\uB0C4</li><li>\uC6B4\uC601\uCCB4\uC81C\uAC00 \uC694\uCCAD\uD558\uB294 \uBA85\uB839\uC744 \uBC1B\uC544 \uC7A5\uCE58\uB97C \uAD6C\uB3D9</li><li>\uC6B4\uC601\uCCB4\uC81C\uAC00 \uBCF4\uB0B4\uB294 \uCD9C\uB825\uC744 \uC7A5\uCE58\uC5D0 \uB9DE\uAC8C \uBCC0\uD658</li></ul></li><li><p><strong>\uC7A5\uCE58 \uB4DC\uB77C\uC774\uBC84</strong></p><ul><li>\uC751\uC6A9 \uD504\uB85C\uADF8\uB7A8\uC758 \uC785\uCD9C\uB825 \uC694\uCCAD\uC744 \uD574\uB2F9 \uC7A5\uCE58\uC5D0 \uB9DE\uB3C4\uB85D \uBCC0\uD658</li><li>\uC7A5\uCE58\uC758 \uC885\uB958\uB098 \uC81C\uC870\uC0AC\uC5D0 \uB530\uB77C \uC7A5\uCE58\uC81C\uC5B4\uAE30\uAC00 \uC774\uD574\uD558\uB294 \uBA85\uB839\uC774\uB098 \uBA85\uB839\uC758 \uC885\uB958\uAC00 \uB2E4\uB97C \uC218 \uC788\uAE30 \uB54C\uBB38\uC774\uB2E4.</li><li>\uBCF4\uD1B5 \uC7A5\uCE58 \uC81C\uC870\uC0AC\uC5D0\uC11C \uD574\uB2F9 \uC7A5\uCE58\uC758 \uB4DC\uB77C\uC774\uBC84\uB3C4 \uAC19\uC774 \uC81C\uACF5</li></ul></li></ul><h3 id="\u1106\u116E\u11AF\u1105\u1175\u110C\u1165\u11A8-\u1100\u116E\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1106\u116E\u11AF\u1105\u1175\u110C\u1165\u11A8-\u1100\u116E\u1109\u1165\u11BC" aria-hidden="true">#</a> \uBB3C\uB9AC\uC801 \uAD6C\uC131</h3><ul><li><strong>CPU\uC758 \uC7A5\uCE58 \uC0AC\uC6A9\uBC95</strong><ul><li>\uC7A5\uCE58\uC81C\uC5B4\uAE30 \uB0B4\uC758 \uB808\uC9C0\uC2A4\uD130\uB97C \uD65C\uC6A9\uD558\uC5EC \uC7A5\uCE58\uB97C \uC0AC\uC6A9\uD568</li><li>\uC7A5\uCE58\uC758 \uC0C1\uD0DC \uD655\uC778(\uC77D\uAE30), \uC7A5\uCE58\uC5D0 \uBA85\uB839(\uC4F0\uAE30)</li><li>\uD1B5\uC2E0: \uC785\uCD9C\uB825 \uBA85\uB839, \uBA54\uBAA8\uB9AC \uC0AC\uC0C1 \uC785\uCD9C\uB825</li></ul></li></ul><p><img src="'+r+'" alt="\uC7A5\uCE58-\uBB3C\uB9AC\uC801\uAD6C\uC131.png"></p><h2 id="\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8-\u110E\u1165\u1105\u1175-\u110B\u1172\u1112\u1167\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8-\u110E\u1165\u1105\u1175-\u110B\u1172\u1112\u1167\u11BC" aria-hidden="true">#</a> \uC785\uCD9C\uB825 \uCC98\uB9AC \uC720\uD615</h2><h3 id="\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8-\u110E\u1165\u1105\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8-\u110E\u1165\u1105\u1175" aria-hidden="true">#</a> \uC785\uCD9C\uB825 \uCC98\uB9AC</h3><ul><li>\uD504\uB85C\uC138\uC2A4\uAC00 \uC9C4\uD589\uD558\uBA70 \uC785\uCD9C\uB825\uC774 \uBC1C\uC0DD\uD558\uB294 \uACBD\uC6B0</li><li>\uC138 \uAC00\uC9C0 \uC720\uD615: \uD504\uB85C\uADF8\uB7A8 \uBC29\uBC95, \uC778\uD130\uB7FD\uD2B8 \uBC29\uBC95, DMA \uBC29\uBC95</li></ul><h3 id="\u1111\u1173\u1105\u1169\u1100\u1173\u1105\u1162\u11B7-\u1107\u1161\u11BC\u1107\u1165\u11B8" tabindex="-1"><a class="header-anchor" href="#\u1111\u1173\u1105\u1169\u1100\u1173\u1105\u1162\u11B7-\u1107\u1161\u11BC\u1107\u1165\u11B8" aria-hidden="true">#</a> \uD504\uB85C\uADF8\uB7A8 \uBC29\uBC95</h3><div class="custom-container tip"><p class="custom-container-title">\uD3F4\uB9C1</p><p>CPU\uAC00 \uC785\uCD9C\uB825\uC7A5\uCE58\uC758 \uC0C1\uD0DC\uB97C \uC9C0\uC18D\uC801\uC73C\uB85C \uD655\uC778\uD558\uBA70 \uC6D0\uD558\uB294 \uC0C1\uD0DC\uAC00 \uB420 \uB54C\uAE4C\uC9C0 \uAE30\uB2E4\uB9AC\uB294 \uAC83</p></div><ul><li>CPU\uB9CC\uC744 \uC774\uC6A9\uD558\uC5EC \uC785\uCD9C\uB825\uC744 \uCC98\uB9AC</li><li>\uD3F4\uB9C1 \uC774\uC6A9</li><li>\uB2E8\uC810: \uBE44\uD6A8\uC728\uC801 - CPU\uC758 \uB0AD\uBE44\uAC00 \uC2EC\uD568</li></ul><h3 id="\u110B\u1175\u11AB\u1110\u1165\u1105\u1165\u11B8\u1110\u1173-\u1107\u1161\u11BC\u1107\u1165\u11B8" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11AB\u1110\u1165\u1105\u1165\u11B8\u1110\u1173-\u1107\u1161\u11BC\u1107\u1165\u11B8" aria-hidden="true">#</a> \uC778\uD130\uB7FD\uD2B8 \uBC29\uBC95</h3><div class="custom-container tip"><p class="custom-container-title">\uC778\uD130\uB7FD\uD2B8(interrupt)</p><p>\uC5B4\uB5A4 \uC7A5\uCE58\uAC00 \uB2E4\uB978 \uC7A5\uCE58\uC758 \uC791\uC5C5\uC744 \uC7A0\uC2DC \uC911\uB2E8\uC2DC\uD0A4\uACE0 \uC790\uC2E0\uC758 \uC0C1\uD0DC\uB97C \uC54C\uB9AC\uB294 \uAE30\uB2A5</p></div><ul><li>\uC778\uD130\uB7FD\uD2B8\uB97C \uC774\uC6A9\uD558\uC5EC \uC785\uCD9C\uB825\uC744 \uCC98\uB9AC</li><li>\uD504\uB85C\uC138\uC2A4\uB97C \uB300\uAE30\uC0C1\uD0DC\uB85C \uBCF4\uB0B4\uACE0 \uC778\uD130\uB7FD\uD2B8\uAC00 \uBC1C\uC0DD\uD560 \uB54C\uAE4C\uC9C0 CPU\uB294 \uB2E4\uB978 \uC791\uC5C5\uC744 \uD558\uBA74 \uB428</li></ul><h3 id="\u110B\u1175\u11AB\u1110\u1165\u1105\u1165\u11B8\u1110\u1173-\u1107\u1161\u11BC\u1107\u1165\u11B8-\u110E\u1165\u1105\u1175\u1100\u116A\u110C\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11AB\u1110\u1165\u1105\u1165\u11B8\u1110\u1173-\u1107\u1161\u11BC\u1107\u1165\u11B8-\u110E\u1165\u1105\u1175\u1100\u116A\u110C\u1165\u11BC" aria-hidden="true">#</a> \uC778\uD130\uB7FD\uD2B8 \uBC29\uBC95 - \uCC98\uB9AC\uACFC\uC815</h3><ol><li>\uC785\uCD9C\uB825\uC7A5\uCE58\uAC00 \uAC00\uC6A9\uD55C \uC0C1\uD0DC\uAC00 \uB418\uC5C8\uB2E4\uACE0 \uC778\uD130\uB7FD\uD2B8 \uC81C\uC5B4\uAE30\uC5D0 \uC2E0\uD638\uB97C \uBCF4\uB0C4</li><li>\uC778\uD130\uB7FD\uD2B8 \uC81C\uC5B4\uAE30\uB294 CPU\uC5D0 \uC778\uD130\uB7FD\uD2B8 \uC2E0\uD638\uB97C \uBCF4\uB0C4</li><li>CPU\uB294 \uD604\uC7AC \uC2E4\uD589\uC911\uC774\uB358 \uBA85\uB839\uB9CC \uB9C8\uCE5C \uD6C4 \uC989\uC2DC \uC778\uD130\uB7FD\uD2B8\uC5D0 \uC751\uB2F5</li><li>\uC778\uD130\uB7FD\uD2B8 \uC81C\uC5B4\uAE30\uB294 \uC774\uBCA4\uD2B8 \uB300\uC0C1\uC5D0 \uB300\uD55C \uC815\uBCF4\uB97C CPU\uC5D0\uAC8C \uBCF4\uB0C4</li><li>CPU\uB294 \uD604\uC7AC \uC0C1\uD0DC\uB97C \uBCF4\uAD00\uD558\uACE0 \uD544\uC694\uD55C \uC785\uCD9C\uB825\uCC98\uB9AC\uB97C \uD55C \uD6C4 \uC6D0\uB798 \uC2E4\uD589\uC0C1\uD0DC\uB85C \uBCF5\uADC0</li></ol><h3 id="dma-\u1107\u1161\u11BC\u1107\u1165\u11B8" tabindex="-1"><a class="header-anchor" href="#dma-\u1107\u1161\u11BC\u1107\u1165\u11B8" aria-hidden="true">#</a> DMA \uBC29\uBC95</h3><div class="custom-container tip"><p class="custom-container-title">DMA (Direct Memory Access)</p><p>CPU\uB97C \uD1B5\uD558\uC9C0 \uC54A\uACE0 \uC9C1\uC811 \uBA54\uBAA8\uB9AC\uC5D0 \uC811\uADFC</p></div><ul><li>DMA \uC81C\uC5B4\uAE30\uB97C \uC774\uC6A9\uD558\uC5EC \uC785\uCD9C\uB825\uC744 \uCC98\uB9AC</li><li>\uD504\uB85C\uC138\uC2A4\uB97C \uB300\uAE30\uC0C1\uD0DC\uB85C \uBCF4\uB0B4\uACE0 \uC778\uD130\uB7FD\uD2B8\uAC00 \uBC1C\uC0DD\uD560 \uB54C\uAE4C\uC9C0 CPU\uB294 \uB2E4\uB978 \uC791\uC5C5\uC744 \uD558\uBA74 \uB428</li><li>\uD55C \uBC88\uC5D0 \uC785\uCD9C\uB825 \uC591\uC774 \uB9CE\uC740 \uACBD\uC6B0\uC5D0\uB3C4 \uD55C \uBC88\uC758 \uC778\uD130\uB7FD\uD2B8\uB9CC \uBC1C\uC0DD (CPU\uC758 \uD6A8\uC728 \uC99D\uB300)</li></ul><h3 id="dma-\u1107\u1161\u11BC\u1107\u1165\u11B8-\u110E\u1165\u1105\u1175\u1100\u116A\u110C\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#dma-\u1107\u1161\u11BC\u1107\u1165\u11B8-\u110E\u1165\u1105\u1175\u1100\u116A\u110C\u1165\u11BC" aria-hidden="true">#</a> DMA \uBC29\uBC95 - \uCC98\uB9AC\uACFC\uC815</h3><ol><li>CPU\uB294 \uC785\uCD9C\uB825\uC5D0 \uD544\uC694\uD55C \uC815\uBCF4\uB97C DMA \uC81C\uC5B4\uAE30\uC5D0 \uB118\uAE40</li><li>**[\uBC18\uBCF5]**DMA \uC81C\uC5B4\uAE30\uB294 \uC18C\uC2A4\uC5D0\uC11C \uBAA9\uC801\uC9C0\uB85C \uB370\uC774\uD130\uB97C \uBCF4\uB0B4\uB3C4\uB85D \uC7A5\uCE58 \uC81C\uC5B4\uAE30\uC5D0 \uC694\uCCAD</li><li>\uC6D0\uD558\uB294 \uC591\uC758 \uC785\uCD9C\uB825\uC774 \uB05D\uB098\uBA74 DMA \uC81C\uC5B4\uAE30\uB294 \uC778\uD130\uB7FD\uD2B8 \uC81C\uC5B4\uAE30\uC5D0 \uC2E0\uD638\uB97C \uBCF4\uB0C4</li><li>\uC778\uD130\uB7FD\uD2B8\uB97C \uBC1C\uC0DD\uC2DC\uCF1C CPU\uC5D0\uAC8C \uC785\uCD9C\uB825 \uC791\uC5C5\uC774 \uBAA8\uB450 \uB05D\uB0AC\uC74C\uC744 \uC54C\uB9BC</li></ol><h3 id="dma-\u1107\u1161\u11BC\u1107\u1165\u11B8-\u1106\u116E\u11AB\u110C\u1166-\u1106\u1175\u11BE-\u1112\u1162\u1100\u1167\u11AF" tabindex="-1"><a class="header-anchor" href="#dma-\u1107\u1161\u11BC\u1107\u1165\u11B8-\u1106\u116E\u11AB\u110C\u1166-\u1106\u1175\u11BE-\u1112\u1162\u1100\u1167\u11AF" aria-hidden="true">#</a> DMA \uBC29\uBC95 - \uBB38\uC81C \uBC0F \uD574\uACB0</h3><ul><li>CPU\uC640 DMA \uC81C\uC5B4\uAE30\uAC00 \uB3D9\uC2DC\uC5D0 \uBA54\uBAA8\uB9AC \uC5D1\uC138\uC2A4\uB97C \uC2DC\uB3C4\uD558\uBA74 \uCDA9\uB3CC (<u><strong>\uC774\uAC70 \uBB34\uC2A8\uB9D0\uC778\uC9C0 \uC774\uD574 \uC880 \uC548\uB428. DMA \uC81C\uC5B4\uAE30\uB3C4 \uACB0\uAD6D CPU\uB97C \uD1B5\uD574 \uB3D9\uC791\uD558\uB294\uAC8C \uC544\uB2CC\uAC00?... \uC880 \uB354 \uCC3E\uC544\uBCF4\uC790</strong></u>)</li><li>\uC0AC\uC774\uD074 \uC2A4\uD2F8\uB9C1(cycle stealing) <ul><li>CPU\uBCF4\uB2E4 DMA \uC81C\uC5B4\uAE30\uC5D0 \uC6B0\uC120\uAD8C \uBD80\uC5EC</li><li>\uC989, CPU\uB85C\uBD80\uD130 \uBA54\uBAA8\uB9AC \uC0AC\uC774\uD074\uC744 \uD6D4\uCCD0 \uB0B4\uB294 \uAC83</li></ul></li></ul><h2 id="\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8-\u1100\u116A\u11AB\u1105\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11B8\u110E\u116E\u11AF\u1105\u1167\u11A8-\u1100\u116A\u11AB\u1105\u1175" aria-hidden="true">#</a> \uC785\uCD9C\uB825 \uAD00\uB9AC</h2><div class="custom-container tip"><p class="custom-container-title">\uBC84\uD37C(buffer)</p><p>\uC785\uCD9C\uB825 \uB370\uC774\uD130 \uB4F1\uC758 \uC815\uBCF4\uB97C \uC804\uC1A1\uD560 \uB54C \uC77C\uC2DC\uC801 \uB370\uC774\uD130 \uC800\uC7A5 \uC7A5\uC18C\uB85C \uC0AC\uC6A9\uB418\uB294 \uBA54\uBAA8\uB9AC\uC758 \uC77C\uBD80</p></div><ul><li>\uBC84\uD37C\uB9C1 <ul><li>CPU\uC758 \uB370\uC774\uD130 \uCC98\uB9AC \uC18D\uB3C4\uC640 \uC785\uCD9C\uB825\uC7A5\uCE58\uC758 \uB370\uC774\uD130 \uC804\uC1A1 \uC18D\uB3C4\uC758 \uCC28\uC774\uB85C \uC778\uD55C \uBB38\uC81C\uB97C \uBC84\uD37C\uB97C \uD1B5\uD574 \uD574\uACB0</li><li>\uC138 \uAC00\uC9C0 \uBC29\uBC95 : \uB2E8\uC77C \uBC84\uD37C\uB9C1, \uC774\uC911 \uBC84\uD37C\uB9C1, \uC21C\uD658 \uBC84\uD37C\uB9C1</li></ul></li></ul><h3 id="\u1109\u1173\u1111\u116E\u11AF\u1105\u1175\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1109\u1173\u1111\u116E\u11AF\u1105\u1175\u11BC" aria-hidden="true">#</a> \uC2A4\uD480\uB9C1</h3><ul><li>\uC785\uCD9C\uB825 \uD504\uB85C\uC138\uC2A4\uC640 \uC800\uC18D \uC785\uCD9C\uB825\uC7A5\uCE58 \uC0AC\uC774\uC758 \uB370\uC774\uD130 \uC804\uC1A1\uC744 \uC790\uAE30 \uB514\uC2A4\uD06C\uC640 \uAC19\uC740 \uACE0\uC18D \uC7A5\uCE58\uB97C \uD1B5\uD558\uB3C4\uB85D \uD558\uB294 \uAC83(\uC77C\uC885\uC758 \uBC84\uD37C\uB9C1)</li><li>\uC785\uCD9C\uB825 \uC791\uC5C5\uC774 \uBE68\uB9AC \uB05D\uB098\uAC8C \uD560 \uC218 \uC788\uC74C</li><li>\uC804\uC6A9\uC7A5\uCE58\uB97C \uAC00\uC0C1\uC7A5\uCE58\uB85C \uBCC0\uD658\uC2DC\uCF1C \uC90C</li></ul>',39),t=[d];function n(s,c){return l(),a("div",null,t)}var o=i(h,[["render",n],["__file","09. \uC7A5\uCE58 \uAD00\uB9AC.html.vue"]]);export{o as default};
